import CoursePage from "./pages/CoursePage";
import WishlistPage from "./pages/WishlistPage";

function Main() {
  return (
    <BrowserRouter>
      <App>
        <Routes>
          <Route path="/" element={<HomePage />} />
          {/* <Route path="courses" element={<CourseListPage />} />
